function Dropdown() {
  return (
    <div>
      <svg
        xmlns="http://www.w3.org/2000/svg"
        width="16"
        height="17"
        viewBox="0 0 16 17"
        fill="none"
        style={{marginRight:'30px'}}
      >
        <path
          d="m4.334 7.167 3.667 3.666 3.666-3.667"
          stroke="#3A4A5B"
          stroke-width="1.5"
          stroke-linecap="round"
          stroke-linejoin="round"
        />
      </svg>
    </div>
  );
}

export default Dropdown;
